import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'

import * as actions from '../../reducer/query/actions'

type FormProps = {
  query: string,
  setQuery: Function,
}

export class FormNav extends React.Component <FormProps, any>{
  constructor(props: any) {
    super(props)
  }

  public static defaultProps = {
    query: ''
  }

  getQueryString() {
    if (!this.props.query) return ''
  }

  render() {
    return (
      <div className="form-nav card">
        <div className="card-content">
          <label htmlFor="time">Time: {`${this.getQueryString()}`}</label>
        </div>
      </div>
    )
  }
}

const mapStateToProps = ({ query: { query }}: any) => ({
  query,
})

function mapDispatchToProps(dispatch: any) {
  return {
    setQuery: bindActionCreators(actions.setQuery, dispatch),
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(FormNav)
